import { Layout, Page, EmptyState } from "@shopify/polaris";

const img =
  "https://vignette.wikia.nocookie.net/scratchpad/images/8/81/Karen-SpongeBobSquarePants.png/revision/latest/scale-to-width-down/340?cb=20180620011244";

const Index = () => (
  <div>
    <Page>
      <Layout>
        <EmptyState
          heading="Discount your products temporarily"
          action={{
            content: "Select products",
            onAction: () => console.log("clicked"),
          }}
          image={img}
        >
          <p>Select products to change their price temporarily.</p>
        </EmptyState>
      </Layout>
    </Page>
  </div>
);

export default Index;
